SELECT l.LetID ,l.DatumPolaska, l.VremePolaska, l.Status, l.Terminal , l.SlobodnoBizKlasa, l.SlobodnoEkoKlasa,l.AvionID,a.Marka,a.Model,a.UkupnoBizKlasa,a.UkupnoEkoKlasa,l.KompanijaID, k.NazivAK,l.DestinacijaID,d.NazivAerodroma,d.Grad,l.PilotID,p.ImeP,p.PrezimeP,p.JMBGP,p.KontaktP,p.AdresaP,p.mail 
			from db.Let as l inner join db.Avion as a on (a.AvionID=l.AvionID) inner join db.Destinacija as d on (l.DestinacijaID=d.DestinacijaID) inner join db.AvioKompanija as k on (k.KompanijaID=l.KompanijaID) inner join db.Pilot as p on (p.PilotID=l.PilotID)
             where LetID= #[message.inboundProperties.'http.uri.params'.id]

